import React, { Component } from 'react';

class Simplon extends Component {
  render() {
    return (
      <div class="gasy-content">
         <canvas id="canvas"></canvas>
         <div class="text">
            <h1>Simplon
              <span id="year"></span>
            </h1>
            <div className="row">
                <div class="col-md-offset-2 col-md-8">

                </div>
            </div>
         </div>
      </div>
    );
  }
}

export default Simplon;
